import React from 'react'
import logo from './Images/Chemilea_Logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="chemilea-body">
        <div className='chemilea-log'><img src={logo} className='chemilea-img' /></div>
      </header>
    </div>
  );
}

export default App;
